  <script src="lib/vega@4.2.0.min.js"></script>
  <script src="lib/vega-lite@3.0.0-rc6.min.js"></script>
  <script src="lib/vega-embed@3.19.2.min.js"></script>
  <script>
    function getParameterByName(name) {
    name = name.replace(/[\[]/, "\\[").replace(/[\]]/, "\\]");
    var regex = new RegExp("[\\?&]" + name + "=([^&#]*)"),
      results = regex.exec(location.search);
    return results === null ? "" : decodeURIComponent(results[1].replace(/\+/g, " "));
  }
  </script>
  <style>
    body {background-color: powderblue;}
    svg {background-color: white;}
    a   {padding: 8px; font-family: arial; font-size: 6pt; color: blue; text-decoration: none;}
  </style>
</head>
<body>

<div id="vis"></div>

<script type="text/javascript">
  var VegaLiteFile = './vl/' + getParameterByName('VegaLiteFile');
  console.log("VegaLiteFile: " + VegaLiteFile);
  if (VegaLiteFile === null || VegaLiteFile === undefined || VegaLiteFile == '') {
    alert(" No Vega-Lite json specified!")
  } else {
    vegaEmbed("#vis", VegaLiteFile, {"actions": true, "renderer": "svg"}).then(function(result) {
    }).catch(console.error);
  }
</script>
